  return (
    <NavStyles>
      <Link href="/songs">
        <a>Songs</a>
      </Link>
      <Link href="/artists">
        <a>Artists</a>
      </Link>
      <Link href="/albums">
        <a>Albums</a>
      </Link>
      <Link href="/composers">
        <a>Composers</a>
      </Link>
    </NavStyles>
  );
};

export default Nav;
